Minecraft supports the ability to have more than one model for a single block. With this we can make it so blocks have variant textures, to make the world look more alive. To do this we are going to need a few things. First we are going to need a texture for each variant you plan to have. Here are the textures I will be using: Variants Files As you can see above, I have 6 diamond ore textures. The first one is named exactly like default and the rest have a _2, _3, _4, _5, _6 after. You will want to copy these textures into your block folder in your resource pack. Once we have done that, we are going to need to get the blockstate file for diamond ore. Go into your extracted minecraft .jar folder, go into the blockstates folder, and copy the blockstate for the block you want to use. Go into your resource pack, into the minecraft folder, and make a folder called blockstate. Then, go into it and paste the blockstate you copied earlier. Now, right-click the blockstate and open it in brackets. This is how it looks: { "variants": { "": { "model": "minecraft:block/diamond_ore" } }
} As you can see there is only 1 variant at the moment. We want to add 5 more. We do this by adding more models like this: { "variants": { "": [ { "model": "minecraft:block/diamond_ore" }, { "model": "minecraft:block/diamond_ore_2" }, { "model": "minecraft:block/diamond_ore_3" }, { "model": "minecraft:block/diamond_ore_4" }, { "model": "minecraft:block/diamond_ore_5" }, { "model": "minecraft:block/diamond_ore_6" } ] }
} To add a list in JSON, you need to use [ to start it and ] to end it. Notice where we place these in the file: after the : that tells minecraft the state to apply these models to, and at the end of the list. The last step is to make the model files. Start by going into the default minecraft models folder, go into blocks, and find diamond_ore.json. Copy it, and place it in the same folder in your pack /assets/minecraft/models/block. Once copied there, you will want to make a copy of it for each variant that you want. Rename these to what you put in the blockstates file: Copy Variant Models Now, you are going to want to open each model, and edit it to point to the correct texture, like this: Edit Variant Model Files Once you have done that for all of them, we can go in game and try it out. Here are my results: Variants In Game

